import { Divider, Typography } from "@mui/material";
import Grid from "@mui/material/Grid";
import TextField from "@mui/material/TextField";
import { useState } from "react";

export default function CreateListing(){

const [title, setTitle] = useState('');
const [rate, setRate] = useState();
const [location, setLocation] = useState('');
const [description, setDescription] = useState('');

const handleTitleChange = (e) => {
    setTitle(e.target.value);
}
const handleRateChange = (e) => {
    setRate(e.target.value);
}
const handleLocationChange = (e) => {
    setLocation(e.target.value);
}
const handleDescriptionChange = (e) => {
    setDescription(e.target.value);
}
    return(
        <div>
            <Typography variant="h3" sx={{justifyContent: 'center', display: 'flex',
            alignItems: 'center', margin:1}}>New Listing</Typography>
            {/*here go the pics*/}
            <Divider sx={{backgroundColor:'peachpuff'}}/>
            <Grid container>
                <Grid xs={8}>
                    <Typography sx={{margin:1}} variant='h6'>Listing Title</Typography>
                    <TextField sx={{margin:1}} placeholder='Enter Title' onChange={handleTitleChange}/>
                </Grid>
                <Grid xs={4}>
                    <Typography sx={{margin:1}} variant='h6'>Nightly Rate</Typography>
                    <TextField sx={{margin:1}} placeholder='Enter Rate' onChange={handleRateChange}/>
                </Grid>
                <Grid xs={8}>
                    <Typography sx={{margin:1}} variant='h6'>Location</Typography>
                    <TextField sx={{margin:1}} placeholder='Enter Location' onChange={handleLocationChange}/>
                </Grid>
            </Grid>
            <Divider sx={{backgroundColor:'peachpuff'}}/>
            <Grid container sx={{justifyContent: 'center', display: 'flex',
            alignItems: 'center', margin:1}}>
                <Typography variant='h6'>Description</Typography>
                <TextField sx={{margin:1}} placeholder='Describe the property...' onChange={handleDescriptionChange}/>
            </Grid>
            <Divider sx={{backgroundColor:'peachpuff'}}/>
        </div>
    )
}
